// SPDX-License-Identifier: MIT


pragma solidity ^0.8.7;


import "@openzeppelin/contracts/access/Ownable.sol";


contract Guardian is Ownable {
    // ----- CUSTOM TYPES ------------------------------------------------------

    struct RootRouter {
        uint128 chainId;
        string adr;
        uint128 poolCodeLength;
    }



    // ----- DATA --------------------------------------------------------------

    RootRouter public rootRouter;



    // ----- SMART CONTRACT MANAGEMENT ------------------------------------------

    function setRootRouter(uint128 chainId, string memory adr, uint128 poolCodeLength) external onlyOwner {
        rootRouter.chainId = chainId;
        rootRouter.adr = adr;
        rootRouter.poolCodeLength = poolCodeLength;
    }

    function removeRootRouter() external onlyOwner {
        rootRouter = RootRouter(0, "", 0);
    }
}
